import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from 'react-router-dom';

import MasterLayout from './layouts/admin/MasterLayout';  

function App() {
  return (
      <Router>
        <Routes>
          <Route path="/admin" name="Admin" render={(props) => <MasterLayout {...props} />} >
          </Route>
        </Routes>
      </Router>
  );
}

export default App;
